import React from 'react'

import Header from '../Auth/Profile/Header'
import ProfileInfo from '../Auth/Profile/ProfileInfo.js'

const FixedWrapper = styled.header`
    position: fixed;
    background-color: var(--color-white);
    padding: 0rem 2rem;
    top: 0;
    left: 0;
    width: 100%;
    height: 8rem;
`
const Container = styled.div`
    width: 100%;
    max-width: 140rem;
    margin: 0 auto;
    height: 100%;
`
const Wrapper = styled.div`
    display: flex;
    height: 100%;
    justify-content: flex-end;
    align-items: center;

    @media ${props => props.theme.mediaQueries.small} {
        justify-content: flex-start;
    }
`
const Ul = styled.ul`
    display: flex;
    flex-direction: row;
    align-items: center;
    height: 70%;

    @media ${props => props.theme.mediaQueries.small} {
        display: none;
    }
`
const SideDrawer = ({ show }) => {
  let sidedrawerClasses = 'sidedrawer'

  if (show) {
    sidedrawerClasses = 'sidedrawer open'
  }

